import React from 'react';
import './ResultsTable.css';
import TableRow from './TableRow';
import TableHeader from './TableHeader';

const ResultsTable = (props) => {
  return (
    <table className="result">
      <TableHeader />
      <tbody>
        <TableRow />
      </tbody>
    </table>
  );
};

export default ResultsTable;
